:root {
    //colors//
    --clr-accent: 26 100% 55%;
    --clr-accent-light: 25 100% 94%;
    --clr-black: 0 0% 6%;
    --clr-white: 0 0% 100%;

    --clr-primary-800: 220 13% 13%;
    --clr-primary-700: 219 9% 45%;
    --clr-primary-600: 220 14% 75%;
    --clr-primary-200: 223 64% 98%;
    //colors//

    // font-sizes //
    --fs-600: clamp(1.2rem, 3vw + 1rem, 2.8rem);
    --fs-500: 1.5rem;
    --fs-400: 0.983rem;
    --fs-300: 0.8rem;


    @media (min-width: 35em) {
        // --fs-500: 1.3rem;
        --fs-400: 1rem;
        --fs-300: 0.9rem;
    }

    @media (min-width: 45em) {
        --fs-500: 1.75rem;
        --fs-400: 1.05rem;
    }

    // font-sizes //
}

body {
    font-family: 'Kumbh Sans', sans-serif;
}

.dim {
    position: fixed;
    top: 0;
    left: 0;
    box-shadow: 0 0 0 100vmax rgba(0, 0, 0, .7);
    pointer-events: none;
    z-index: 200;
    opacity: 0;
    transition: opacity 0.5s ease-in-out;

    &[data-visible=true] {
        opacity: 1;
    }
}

